import React from "react";
import { Button } from "react-bootstrap";

export default function EventCards(props) {
  console.log("props", props);
  return (
    <div style={{ border: "2px solid" }}>
      <h1>{props.title}</h1>
      <Button onClick={props.handleClick}>View</Button>
    </div>
  );
}
